import NavigationBar from "../Components/NavigationBar";
import Footer from "../Components/Footer";
import Aside from "../Components/AsideLeft";
function App({ children }) {
  return (
    <div className="App">
      <div className="container">
        <NavigationBar />
        <Aside />
        <div>{children}</div>
        <Footer />
      </div>
    </div>
  );
}

export default App;
